import React from 'react'

const inputStyle={
    border: '2px solid #FFF',
    padding: '5px',
    borderRadius: '10px',
    cursor: 'pointer',
    transition: '1s'
}

const Input = () => {
  render (
    <input const={inputStyle}>Input</input>
  )
}

export default Input
